
public class SwitchCaseEx2 {

	public static void main(String[] args) {

// TODO Auto-generated method stub
		String s ="female";
		switch(s){
		case "female":
			System.out.println("s is female");
			break;
		case "male":
			System.out.println("s is male");
			break;
			default:
				System.out.println("s has no gender");
		}
		
		

	}

}
